import React from "react";

const Footer = () =>{
    return(
        <div id="contact" className="contact-section">
                <h2 className="section-heading">Liên Hệ</h2>
                <div className="row contact-content">
                    <div className="col col-2 contact-info">
                    <p><i className="ti-location-pin"> * Click đặt hàng - Ship tận răng *</i> </p>
                        
                        <p><i className="ti-mobile"> +0776122861</i> </p>
                        <p><i className="ti-location-pin"> Đà Nẵng, Việt Nam</i> </p>
                        <p><i className="ti-email"> Email: mail@mail.com</i> </p>
                    </div>
                </div>       
        </div>  
    )
}

export default Footer;
